import React, { useState } from 'react'
import styled from 'styled-components'
 const arrHome = ["MAIN HOME","APP PRESENTATION","CRYPTO ADVISOR","CRYPTO AGENCY","ICO HOME","BLOCKCHAIN APP","VERTICAL SLIDER","BLOG HOME","LANDING"];

const NavBar=()=>{
    const[child_home,Setchild_home]= useState(arrHome);

   return(
        <Box_nav>
            <Nav className="container">
                <Menu>
                    <Logo_nav>
                        <img src="images/logo.png" alt="" />
                    </Logo_nav>
                    <Contents_nav>

                        <ul>
                            <li className="active"><a href="">HOME</a>
                                <Child>
                                <li><a href="">MAIN HOME</a></li>
                                    {/* <ul>
                                        <li><a href="">MAIN HOME</a></li>
                                        <li><a href="">APP PRESENTATION</a></li>
                                        <li><a href="">CRYPTO ADVISOR</a></li>
                                        <li><a href="">CRYPTO AGENCY</a></li>
                                        <li><a href="">ICO HOME</a></li>
                                        <li><a href="">BLOCKCHAIN APP</a></li>
                                        <li><a href="">VERTICAL SLIDER</a></li>
                                        <li><a href="">BLOG HOME</a></li>
                                        <li><a href="">LANDING</a></li>
                                    </ul> */}
                                </Child>
                            </li>
                            <li><a href="">PAGES</a></li>
                            <li><a href="">CURRENCIES</a></li>
                            <li><a href="">PORTFOLIO</a></li>
                            <li><a href="">BLOG</a></li>
                            <li><a href="">SHOP</a></li>
                            <li><a href="">ELEMENTS</a></li>
                        </ul>

                        <Btn_menu>
                            <div className="btn">
                                Login
                            </div>
                        </Btn_menu>
                    </Contents_nav>
                </Menu>
            </Nav>
        </Box_nav>
   );
}

const Box_nav= styled.nav`
    padding:0;
    position:absolute;
    top:0;
    left:0;
    right:0;
    z-index:9999999;
`

const Nav = styled.div`
    display:block;
    with:100%;
    padding:0;
`
const Menu = styled.div`
    width:100%;
    height:100px;
    line-height:90px;
    display:flex;
    flex-direction:row;
    flex-grow:1;
`

const Logo_nav = styled.div`
    height: 100%;
    flex-grow:1;

    img{
        width:91px;
        height:27px;
    }
`

const Contents_nav = styled.div`
    height: 100%;
    flex-grow:3;
    display:flex;
    flex-direction:row;

    ul{
    height: 100%;
    flex-grow:4;
    padding: 0;
    list-style: none;
    display: flex;
    flex-direction: row;
    justify-content: space-evenly;
    flex-wrap: wrap;   
    }

    li{
        cursor: pointer;
        :hover a{
            color:#aceb2f;
        }
        position:relative;
    }
    

    li a{
        color:white;
        text-decoration:none;
        font-weight:bold;
        font-family: 'Roboto', sans-serif;
        letter-spacing: 2px;
        transition:all .5s;
    }

    li.active a{
        color:#aceb2f;
    }

   
`
const Btn_menu = styled.div`
    height: 100%;
    flex-grow:2;
    .btn{
        width:70%;
        padding:13px 0;
        border:2px solid #aceb2f;
        border-radius: 50px;
        color:white;
    }
`


const Child = styled.div`
    position:absolute;
    background:red;
    width:400%;
    height:300px;
    top:100%;
     
`

export default NavBar
